import React from 'react'
import {Container} from '../components/Styles/Container/Container.style.js'
import {Header, MainHeader} from '../components/Styles/Header/Header.styled.js';

const Home = () => {
  return (
    <div>
          <Container>
      <Header>
        <MainHeader>
          <h1>This is my portfolio</h1>
        </MainHeader>
      </Header>
    </Container>
    </div>
  )
}

export default Home;
